import React from "react";

class Login extends React.Component {
  state = {};
  render() {
    return (
      <div>
        <h1>Login</h1>
        <h3>Email address</h3>
        <input type="text" value="Email"></input>
        <h3>Password</h3>
        <input type="text" value="Password"></input>
      </div>
    );
  }
}

export default Login;
